        return throwHttpGraphQLError(
          response.http?.status || 400,
          response.errors as any,
          undefined,
          response.extensions,
          response.http?.headers,
        );
      }

      if (response.http) {
        for (const [name, value] of response.http.headers) {
          responseInit.headers![name] = value;
